    false,nt"url": null,nt"notes": "This report documents a field investigation
    of goose productivity in 1984 conducted on Nelson Island on the Yukon Delta National
    Wildlife Refuge. The procedures used and the objectives of the study were established
    by Ron L. Garrett, refuge biologist, as part of a monitoring and research program
    conducted at 6 permanent field camp locations. The background material, objectives
    and methods are described in other reports and these will not be repeated here.
    The contents, data analysis, and format follows the example of Wege and Garrett
    to allow comparison among the various field camps. Information on the study area,
    methods used, and results are discussed. Data forms are attached.",nt"license_title":
